    false,nt"url": null,nt"notes": "This report covers the movement of molting
    oldsquaw within the Beaufort Sea Coastal lagoons of the Arctic National Wildlife
    Refuge, Alaska. During August, 1983, 16 molting oldsquaw were captured in Tapkaurak
    Lagoon and fitted with a backpack radio transmitter. Birds were relocated each day
    that weather permitted until they departed the refuge. Over 75% of the oldsquaw
    relocation points were within lagoons or within 400 m of barrier islands in the
    ocean. Radioed oldsquaw were relatively sedentary with 47% of relocations in Tapkaurak
    - Oruktalik lagoon system where captured. , Nearly 90% of the relocation points
    were found in water less than 5 m deep. The average movement rate for the 9 oldsquaw
    alive at the onset of migration ranged from 1.77 to 12.20 km/day. The average daily
    movement rate for males exceeded that for females, but the difference was not significant.
    The average date of migration initiation was 22 September, and coincided with the
    beginning of lagoon freeze up. The relocation data suggests oldsquaw move from lagoons
    to offshore and ocean areas as molt is completed and migration begins. The radio
    relocation data is in agreement with the distribution data obtained during the 1983
    aerial surveys.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
